To solve the inequality $x^2 - 5x - 4 \le 10$, we first simplify the left by subtracting 10 from both sides:
\begin{align*}
x^2 - 5x - 4 - 10 &\le 0 \\
x^2 - 5x - 14 &\le 0.
\end{align*}
Next, we solve the quadratic equation $x^2 - 5x - 14 = 0$ by factoring:
\begin{align*}
(x - 7)(x + 2) &= 0.
\end{align*}
The roots of this are $x = 7$ and $x = -2$. The quadratic inequality $x^2 - 5x - 14 \le 0$ is where the quadratic expression is less than or equal to zero. This occurs between the roots, including the roots themselves. Therefore, the solution to the inequality is $
(-\infty, -2] \cup [-2, 7]$.
</reasoning>
